import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import ReactFormInputValidation from "react-form-input-validation";


export class SignIn extends Component {


    constructor(props) {
        super(props);
        this.state = {
            fields: {
                email: "",
                password: ""
            },
            errors: {}
        };
        this.form = new ReactFormInputValidation(this);
        this.form.useRules({
            email: "required|email",
            password: "required"
        });
        this.form.onformsubmit = (fields) => {
            return;
        }
    }

    render() {
        return (
            <React.Fragment>
                <div className="wrapper fadeInDown mt-5 pt-5">
                    <div id="formContent">
                        <h2 className="active signh2" > Sign In </h2>
                        <div className="fadeIn first">
                            <i className="fa-solid fa-user fa-6x mb-2 mt-2"></i>
                        </div>

                        <form action="/Dashboard" method="GET" >
                            <input type="email" placeholder="Email adress" name="email" onBlur={this.form.handleBlurEvent} onChange={this.form.handleChangeEvent} value={this.state.fields.email}/>
                            {this.state.errors.email && (
                                <div>
                                    <label className="error">{this.state.errors.email ? this.state.errors.email : ""}</label>
                                </div>
                            )}
                            <input type="password" placeholder="Password" name="password" onBlur={this.form.handleBlurEvent} onChange={this.form.handleChangeEvent} value={this.state.fields.password}/>
                            {this.state.errors.password && (
                                <div>
                                    <label className="error">{this.state.errors.password ? this.state.errors.password : ""}</label>
                                </div>
                            )}

                            <input type="submit" className="fadeIn fourth" value="Log In" />
                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/forget-password">Forgot Password?</Link>
                            <br />
                            <Link className="underlineHover" to="/register">Create an account ?</Link>
                        </div>
                    </div>
                </div>

            </React.Fragment>
        );
    }
}

export default SignIn
